TemplateModel.StyleSheet:
.ul{
	padding-bottom:0px;
}

.OM_Blue{
	background:#184f92;
}

.OM_GRed{
	background:#950004;
}

.OM_Red{
	background:#e50003;
}

.OM_Purple{
	background:#c101a6;
}

.OM_SBlue{
	background:#07bff5;
}

.OM_Orange{
	background: #f89209;
}

.OM_Aqua{
	background:#165660;
}

.OM_DOrange{
	background:#fa3d05;
}

.OM_SuperLeague{
	background: #01305d;
}

.OM_SLBadge{
	width: 10%;    
    	position: absolute;
    	top: 0;
    	right: 2%; 
}

.OutrightMarkets{
	width:100%;
	height:100%;
	text-transform:uppercase;
	font-weight:bold;
	background:black;
}

.OM_Header{
	width:100%;
	height:15%;
	background: black;
	color:white;
	border-bottom: 0.1vw solid white;
}

.OM_FBHeader{
        background: #1a6331;
}

.OM_title{
	font-size:135%;;
	text-align:center;
	
	line-height: 180%;
	
}

.OM_marketTitle{
	font-size:100%;
	text-align:center;
	
	line-height: 120%;
}

.OM_marketZone{
	width:100%;
	float:left;
	height:78%;
	display: inline-flex;
}

.OM_selection{
	display:table-row;
	width:100%;	
    	background: -webkit-linear-gradient(top,#fff 0,#fff 25%,#EBEBEB 75%,#EBEBEB 100%);
    	background: -moz-linear-gradient(top,#fff 0,#fff 25%,#EBEBEB 75%,#EBEBEB 100%);
	font-size:100%;
}

.OM_selectionName{
	width:80%;
	display:table-cell;
	color:black;	
	vertical-align:middle;
	padding-left:2%;
}

.OM_selectionPrice{
	width:20%;
	display:table-cell;
	color:white;
	text-align:center;
	background-color: black;
	border: 0.1vw solid white;
	vertical-align:middle;
}

.OM_selectionFBPrice{
	width:20%;
	display:table-cell;
	color:white;
	text-align:center;
       background: #1a6331;
	vertical-align:middle;
}

.OM_splitTable{
	display:table;
	width:44%;
	height:100%;
}

.OM_splitImage{
	width:12%;
	height:100%;
}

.OM_table{
	display:table;
	width:60%;
	height:100%;
}

.OM_image{
	width:40%;
	height:100%;
}

.OM_footer{
	width:100%;
	height:7%;
	color:white;
	font-size:100%;
	text-align:center;
	font-weight:bold;
	display:inline-block;
	padding-top: 1%;
	border-top: 0.1vw solid white;
}
    .InplayBadge{
        position: absolute;
        top: 0%;
        left: 0%;
        width: 100%;
        height: 100%;
    }
.InplayBadgeOutrightLeft {
      position: absolute;
      width: 15%;
      height: 6%;
      top: 93.5%;
      left: 5%;

      }
.InplayBadgeOutrightRight {
      position: absolute;
      width: 15%;
      height: 6%;
      top: 93.5%;
      left: 80%;

      }
